// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract storeData {
    struct BetEvent {
        uint256 id;
        string name;
        string[] options;
        uint256 startTime;
        uint256 endTime;
        bool isCompleted;
        string winningOption;
    }

    mapping(uint256 => BetEvent) public events;
    uint256 public nextEventId;
    address public admin;

    event EventCreated(
        uint256 id,
        string name,
        uint256 startTime,
        uint256 endTime
    );
    event WinnerDeclared(uint256 id, string winningOption);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function createEvent(
        string memory _name,
        string[] memory _options,
        uint256 _startTime,
        uint256 _endTime
    ) external onlyAdmin {
        require(_startTime < _endTime, "Start time must be before end time");
        require(
            _options.length > 1,
            "There must be at least two betting options"
        );

        events[nextEventId] = BetEvent({
            id: nextEventId,
            name: _name,
            options: _options,
            startTime: _startTime,
            endTime: _endTime,
            isCompleted: false,
            winningOption: ""
        });

        emit EventCreated(nextEventId, _name, _startTime, _endTime);
        nextEventId++;
    }

    function declareWinner(
        uint256 _eventId,
        string memory _winningOption
    ) external onlyAdmin {
        BetEvent storage betEvent = events[_eventId];
        require(!betEvent.isCompleted, "Event already completed");
        require(block.timestamp >= betEvent.endTime, "Event not ended yet");

        bool validOption = false;
        for (uint256 i = 0; i < betEvent.options.length; i++) {
            if (
                keccak256(abi.encodePacked(betEvent.options[i])) ==
                keccak256(abi.encodePacked(_winningOption))
            ) {
                validOption = true;
                break;
            }
        }
        require(validOption, "Invalid option");

        betEvent.winningOption = _winningOption;
        betEvent.isCompleted = true;

        emit WinnerDeclared(_eventId, _winningOption);
    }

    function getEvent(
        uint256 _eventId
    ) external view returns (BetEvent memory) {
        return events[_eventId];
    }

    function getEventOptions(
        uint256 _eventId
    ) external view returns (string[] memory) {
        return events[_eventId].options;
    }
}
